import { Box } from "@mui/material";
import { TestChart } from "./ChartComponent/ChartComponent";
import * as SC from "./ChartComponent/ChartComponent.styled";

export const TestChartContainer = ({ chart }) => {
  return (
    <Box
      sx={{
        width: "100%",
        height: "100%",
        p: 2,
        display: "flex",
        flexDirection: "column",
        backgroundColor: "#5e35b1",
        borderRadius: "12px",
        overflow: "hidden",
        position: "relative",
        "&::before": before,
        "&::after": after,
      }}
    >
      <Box
        sx={{
          width: "100%",
          position: "relative",
          zIndex: "5",
        }}
      >
        <TestChart chartConfig={chart.chartConfig} />
      </Box>
    </Box>
  );
};
